import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import kest1 from'./kest.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import Scrollspy1 from './scrollspy';

function nav(){

   return(
        <>
    <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
      <Container fluid>
      <div  className='bg-dark'>
        <hr style={{ backgroundColor:'white', width:'90%',height:'2px',border:'none'}}/>
        <hr style={{ backgroundColor:'white', width:'50%',height:'2px',border:'none'}}/>
        <hr style={{ backgroundColor:'white', width:'20%',height:'2px',border:'none'}}/>
      </div>
      <div>
       <Navbar.Brand href="#home">
            <img
              src={kest1} 
              width={180}
              height={25}
              className="d-inline-block align-top ps-5"
              alt="React Bootstrap logo"
            />
            
        </Navbar.Brand> 
        <Navbar.Collapse id="basic-navbar-nav" className='px-10'>
          <Scrollspy1/>
        </Navbar.Collapse> 
        </div>
      </Container>
    </Navbar>
  
        </>
      );
    }
    
   
    export default nav;
